import React from "react";

function Quantity(props) {
  return (
    <span>
      <button>-</button>
      {props.quantity}
      <button onClick={props.onIncrement}>+</button>
      <button onClick={props.Decrement}>+</button>
    </span>
  );
}

export default Quantity;
